import footerIcon1 from '../assets/icon/footer/ic_baseline-telegram.png'
import footerIcon2 from '../assets/icon/footer/entypo-social_vk-with-circle.png'
import footerIcon3 from '../assets/icon/footer/mdi_pinterest.png'
import footerIcon4 from '../assets/icon/footer/mdi_skype.png'
const footer = [
    {
            footerContactText: [
                {
                    id: 0,
                    contactText: [
                        {
                            id: 0,
                            text: 'Компания «РумТибет»'
                        },
                        {
                            id: 1,
                            text: 'Его корни уходят в один фрагмент классической латыни 45 года н.э., то есть более двух тысячелетий назад. Ричард МакКлинток, профессор латыни из колледжа Hampden-Sydney.'
                        }   
                    ],
                    contactPhoneText: [
                        {
                            id: 0,
                            text: 'info@domain.com'
                        },
                        {
                            id: 1,
                            text: '+7 (123) 456-78-90'
                        }
                    ],
                    footer_icon: [
                        {
                            id: 0,
                            icon: footerIcon1
                        },
                        {
                            id: 1,
                            icon: footerIcon2
                        },
                        {
                            id: 2,
                            icon: footerIcon3
                        },
                        {
                            id: 3,
                            icon: footerIcon4
                        }
                    ]
                },
            ],
            nashiUslugi: [
                {
                    nashiUslugiTitle: [
                        {
                            text: {}
                        }
                    ]
                }
            ]
    }
]
export default footer
